INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "春咲 ひより", 1001, "お！\nあそこに困ってそうな人発見！", 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "草野 優衣", 1002, "大切な人を\n守れるようになりたい…って", 1, "みんなみたいに\nわたしも強くならなきゃ", "わ、わたし、\nなに言ってるんだろ\nあはは…", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "士条 怜", 1003, "キミに必要な集中力と感性が", 1, "フェンシングを始めてみては？", "少しは磨かれると思いますよ。", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.5, 1, 0, "穂高 みそぎ", 1004, "今日はなにして遊ぶ？", 1, "ねぇ、にいちゃん！", "みそぎはねぇ、\nかくれんぼやりたい！", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "風宮 あかり", 1006, "ねぇ…", 1, "風宮あかりです", "私といっしょに…\nいかない？", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.5, 1, 0, "出雲 宮子", 1007, "プリンたべたいのー", 1, "出雲宮子なのー", "食べ物の恨みは怖いのー", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "虹村 雪", 1008, "キミもボクの美貌に\n吸い寄せられたんだね。", 1, "ボクは虹村雪。", "いいよ。\n見られることは運命さ…", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "柊杏奈", 1009, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1, "フッ…聞いて後悔するがいい！", "人呼んで「疾風の冥姫」!!", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.5, 1, 0, "姫宮 真歩", 1010, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1, "マホマホ王国のプリンセス、\nまほ姫どす", "ほんまおおきにやわ～♪", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "衣之咲 璃乃", 1011, "生き別れたお兄ちゃんを探して\n三千世界！", 1, "衣之咲璃乃です！", "ここで会ったが\n100年目～！", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "柏崎 初音", 1012, "ち、超能力って…\n何のことかな～？", 1, "私はハツネ、\n結構強いんだよ。\nきらーん☆", "…って、お願い！\n誰にも言わないでおいて～！", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "美波 鈴奈", 1016, "一応カリスマ読モJKやってまっす！", 1, "ちょす！\n美波鈴奈だよ～♪", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "喜屋武 香織", 1017, "東京は遊園地みたいなところさー", 1, "はいたーい。\n喜屋武香織さー。", "でも、沖縄もとってもいいとこさー", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "支倉 伊緒", 1018, "先生って呼ばれるのは\nくすぐったいから", 1, "支倉伊緒です。", "イオちゃんって呼んでね。", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.5, 1, 0, "茜 ミミ", 1020, "あ！/\お兄ちゃ～ん\nまってよ～", 1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", "ミミをおいてかないでぇ～", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.5, 1, 0, "栗林 くるみ", 1021, "あの……\nふぇ……", 1, "あ…あの…えっと…\n栗…林…くるみ…です……", "ふぇぇぇぇぇん……", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "風宮 より", 1022, "こんな私に貴重な時間を\n割いていただき、", 1, "風宮よりです。\nあああああ！", "なんてありがとうございます！", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.5, 1, 0, "北条 綾音", 1023, "おにいちゃんどこいくの？\nえ？", 1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", "私こっち行きたいー\nね、早く早くー", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "天野 すずめ", 1025, "ふ、不束者ですが\nどうぞ末永く…って、", 1, "わっ…わっ…私、\n天野すずめといいます！", "これて何か違う…\nあああすみません！", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "倉石 恵理子", 1027, "あなたは…運命の……\n伴侶……", 1, "……クスクス…私は\n…倉石恵理子……", "離しませんわ………\n絶対に…!!", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "佐々木 咲恋", 1028, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", "…そうでしょ？？", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "桜井 望", 1029, "ぇっと…\nキミ、私のこと知らないの?!", 1, "桜井望だよ！\nよろしくねっ", "あはは、\n私もまだまだだなぁ～", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "ニノン・ジュベール", 1030, "初めまして、\n私はニノン・ジュベール申すデス！", 1, "デケデケデンっ！", "ショーグン、\nワタシと一緒に天下統一デース！", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "上喜 しのぶ", 1031, "でもって私の隣にいるのが……\nえ、見えない？", 1, "上喜しのぶです。\n手元のドクロが父です。", "おかしいですね……", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.5, 1, 0, "野戸まひる", 1033, "けんども\nそれには足りないモンが…", 1, "目指すはビッグな\nお笑い芸人だっぺ！", "そう、\nオラのボケに突っ込める相方が…！", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "綾瀬 ゆかり", 1034, "ちょっと緊張しちゃって…", 1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", "ちょ\nちょっと一杯飲んできます…！", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.5, 1, 0, "氷川 鏡華", 1036, "知らない人とは話しちゃいけないので", 1, "氷川鏡華…です", "これ以上お話しすることは…\nないです！", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "柏崎 栞", 1038, "……あ、アラーム。", 1, "柏崎…栞です。", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "双葉 碧", 1040, "私、一人も友達がいなくて……", 1, "ふ、双葉碧です。", "野に咲く花が、\n唯一の話相手です。", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "三角 千歌", 1042, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1, "三角千歌です。", "そう思っています。", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "安芸 真琴", 1043, "あぁ？\nお前のそいつの仲間か？", 1, "安芸真琴だ。", "う、疑ってすまなかったな…", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "イリヤ・オーンスタイン", 1044, "生けとし生ける全ての者よ！", 1, "わらわこそは夜を総べる者！", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "遠見 空花", 1045, "ぐふふふふ……はっ！", 1, "そこで騎士は妖精を乱暴に……", "ｌク、クウカに何かご用ですか!?", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "宮坂たまき", 1046, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1, "宮坂たまきにゃ♪\n猫はいいにゃよ？", "う～ん…\n猫ってホントに最高にゃ～♪", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "大神 美冬", 1048, "それでは早速クエストに…", 1, "大神美冬よ！", "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "星野静流", 1049, "クエストもバトルも\n掃除も洗濯も", 1, "星野静流だよ！", "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.5, 1, 0, "玉泉美咲", 1050, "見ての通りの\nセクシー美少女で", 1, "アタシは玉泉美咲。", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1, 0);
INSERT INTO `v1_0666abf13d1d2897768c56a5e2497a724b38f8db6e3ac8ccd04d82030c895462` VALUES (2, 0, 0, 0, 1.4, 1, 0, "リマ", 1052, "？？？？", 1, "？？？", "？？？？", 1, 0);
